    <td><![endif]>
    <div>
    <p class=MsoNormal align=center style='text-align:center'>Oceanía es uno de
    los seis continentes del planeta y el más pequeño de todos. Se ubica al sur
    del océano Pacífico, al oeste del océano Índico y al sureste del continente
    asiático. Tiene una extensión aproximada de 8,7 millones de kilómetros
    cuadrados, lo que representa el 5.9 % del total de la superficie terrestre
    del planeta.</p>
